    return (
        <div className="MovieBox">
            {/* <img src={`https://image.tmdb.org/t/p/w400/${list && list.poster_path }`} alt={`${list && list.release_date } Poster`} /> */}
            <img src={`${poster_img400}/${poster}`} alt={`${list }`}/>
           <div className="Movie_info">
               {title}
               {overview}
                

            </div>

            

        </div>


    )
}

